import React from "react";
import ReactBootstrap, {Nav, Button, Navbar, FormControl, Form} from 'react-bootstrap'

function Header() {
    return (
    <div>
        <header>
        <Navbar bg="#955F61" variant="dark">
    <Navbar.Brand href="#home">KhanaShana</Navbar.Brand>
    <Nav className="mr-auto">
      <div className = "leftbuttons">
      <Nav.Link href="#home">Menu</Nav.Link>
      <Nav.Link href="#features">Services</Nav.Link>
      <Nav.Link href="#pricing">AboutUs</Nav.Link>
      </div>
      <div className= "rightbuttons">
      <Nav.Link href="#home">ContactUs</Nav.Link>
      <Nav.Link href="#features">Login</Nav.Link>
      </div>
      {/* <Nav.Link className = "buttonsleft" href="#pricing">AboutUs</Nav.Link> */}
    </Nav>
    {/* <Form inline>
      <FormControl type="text" placeholder="Search" className="text" />
      <Button variant="outline-info">Search</Button>
    </Form> */}
  </Navbar>
        </header>
    </div>
    );
}

export default Header;
